function App(){
  return(
    <div className="App">
      <Router>
        <Navigationn />
        <Switch>
          <Route path="/" exact component ={() => <Home />} />
          <Route path="/about" exact component ={() => <About/>} />
        </Switch>
        <Footer />
        </Router>
        </div>
  )
}

export default App;



















